import React from "react";
import {
  Badge,
  Button,
  Card,
  Breadcrumb,
  Container,
  Row,
  Col,
  Spinner,
} from "react-bootstrap";
import TableChoferesHead from "./TableChoferesHead";
import TableChoferesBody from "./TableChoferesBody";

const TableChofere = ({
  choferes,
  setModalShow,
  setdataToEdit,
  setDataToDelShow,
  setdataToDel,
  loading,
}) => {
  let styles = {
    with: "3rem",
    height: "3rem",
  };
  console.log("ver loading", loading);
  return (
    <>
      <Container>
        <Row>
          <Col md="12">
            <Breadcrumb>
              <Breadcrumb.Item>Choferes </Breadcrumb.Item>
              <Breadcrumb.Item active>Lista</Breadcrumb.Item>
            </Breadcrumb>
            {loading && (
              <div className="d-flex justify-content-center" s>
                <Spinner
                  animation="border"
                  variant="primary"
                  status="role"
                  size="lg"
                />
              </div>
            )}
            {!loading && (
              <Card className="strpied-tabled-with-hover">
                <Card.Header className="d-flex justify-content-between">
                  <TableChoferesHead />
                  <Button
                    onClick={setModalShow}
                    type="Submit"
                    className="btn-fill "
                    variant="success"
                  >
                    Adicionar Chofer
                  </Button>
                </Card.Header>
                <Card.Body className="table-full-width table-responsive px-0">
                  <TableChoferesBody
                    setModalShow={setModalShow}
                    choferes={choferes}
                    setModalShow={setModalShow}
                    setdataToEdit={setdataToEdit}
                    setdataToDel={setdataToDel}
                    setDataToDelShow={setDataToDelShow}
                    loading={loading}
                  />
                </Card.Body>
              </Card>
            )}
          </Col>
        </Row>
      </Container>
    </>
  );
};

export default TableChofere;
